            return
        }
        const nameToPlaylist = ssangervasi.setupPlaylists(runtimeScene)
        if (!nameToPlaylist.has(playlistName) || fresh) {
            nameToPlaylist.set(playlistName, new ssangervasi.Playlist())
        }
        return nameToPlaylist.get(playlistName)
    }

    const setupPlaylists = (aRuntimeScene) => {
        if (!runtimeScene._srs_utils) {
            runtimeScene._srs_utils = {};
        }
        if (!runtimeScene._srs_utils.nameToPlaylist) {
            runtimeScene._srs_utils.nameToPlaylist = new Map();
        }

        return runtimeScene._srs_utils.nameToPlaylist;
    }

    class Playlist {
        constructor() {
            this.items = []
            this.current = null
        }

        getCurrent() {
            if (this.current === null) {
                return null
            }
            return this.items[this.current]
        }

        add(item) {
            this.items.push(item)
            if (this.current === null) {
                this.current = 0
            }
        }

        skipTo(targetItem) {
            const foundIndex = this.items.findIndex(item => item === targetItem)
            if (foundIndex === -1) { return null }

            this.current = foundIndex
            return this.getCurrent()
        }

        next() {
            if (this.current === null) { return null }

            this.current = (this.current + 1) % this.items.length
            return this.getCurrent()
        }

        previous() {
            if (this.current === null) { return null }

            this.current = this.current - 1
            if (this.current < 0) {
                this.current = this.items.length + this.current
            }
            return this.getCurrent()
        }
    }

    Object.assign(
        ssangervasi,
        {
            getPlaylist,
            setupPlaylists,
            Playlist
        }
    )

})();

